import HardSkills from './HardSkills';
import SoftSkills from './SoftSkills'
import NavBar from './NavBar';


class Skills extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <div>
                <NavBar />                
                <div className='Block'>
                    <h1 className='Titles'>Je sais très bien faire le café</h1>
                    <br />
                    <h2 className='SkillsTitles'>Mais je sais faire plein d'autres choses !</h2>
                    < HardSkills />
                    <h2 className='SkillsTitles'>Et il parait que je suis sympa !</h2>
                    < SoftSkills/>
                </div>
            </div>
            );
    }
}

export default Skills;
